import React from "react";
import {
    ResponsiveContainer,
    ComposedChart,
    AreaChart,
    LineChart,
    Line,
    Area,
    PieChart,
    Pie,
    Cell,
    YAxis,
    XAxis,
    Legend,
    Tooltip,
    BarChart,
    Bar
  } from "recharts";

const SecCharts = props => {
  let { chartState, stats, level, color, data } = props;

  switch (chartState) {
    case "overall":
      return <ResponsiveContainer width="100%" minWidth={500} height={350}>
      <PieChart
        margin={{ top: 0, right: -15, left: -15, bottom: 0 }}
        data={data}
      >
        <Pie data={data} dataKey={stats} nameKey={level} label>
        {

          data.map((entry, index) => <Cell key={`cell-${index}`} fill={color[index % color.length]} />)
        }
        </Pie>
      </PieChart>
    </ResponsiveContainer>

      break;
    case "dashboard":
      return <ResponsiveContainer width="100%" minWidth={500} height={350}>
      <PieChart
        margin={{ top: 0, right: -15, left: -15, bottom: 0 }}
        data={data}
      >
        <Pie data={data} dataKey={stats} nameKey={level} label>
        {

          data.map((entry, index) => <Cell key={`cell-${index}`} fill={color[index % color.length]} />)
        }
        </Pie>
      </PieChart>
    </ResponsiveContainer>
      break;
    default:
      return null;
  }
};

export default SecCharts;
